// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

// Voting
contract Voting {

    // When new voting was created
    event VotingCreated(uint256 indexed id, address indexed owner);
    event Voted(uint256 indexed id, address indexed voter);

    // Owner of the contract (for admin controls)
    address owner;

    // Votings
    uint256 votingCounter = 0;
    mapping (address => uint256) votings;
    mapping (uint256 => uint256[]) votes;
    mapping (uint256 => string[]) optionNames;
    mapping (uint256 => string) votesName;
    mapping (address => mapping(uint256 => uint256)) voted;
    mapping (uint256 => mapping(uint256 => address[])) voters;

    // allowed to vote
    mapping (address => mapping(uint256 => uint256)) votingAllowed;

    // Set owner and DI OriToken
    constructor() {
        owner = msg.sender;
    }

    // Create new Voting
    function createVoting(string memory name) public payable returns (uint256) {
        votings[_msgSender()] = votingCounter;

        uint256[] memory emptyArray;
        votes[votingCounter] = emptyArray;
        votesName[votingCounter] = name;

        string[] memory _optionNames;
        optionNames[votingCounter] = _optionNames;

        emit VotingCreated(votingCounter, _msgSender());

        return votingCounter++;
    }

    struct votingModel {
        uint256 id;
        string name;
    }

    // Add option
    function addOption(uint256 voting, string memory name) public returns (bool) {
        votes[voting].push(0);
        optionNames[voting].push(name);
        return true;
    }

    function canIVote(uint256 voting) public view returns (uint256){
        return votingAllowed[_msgSender()][voting];
    }

    function myVotes(uint256 voting) public view returns (uint256){
        return voted[_msgSender()][voting];
    }

    // Vote
    function vote(uint256 voting, uint256 _vote) public payable returns (bool) {
        if (votingAllowed[_msgSender()][voting] == 0)
            return false;

        if (votingAllowed[_msgSender()][voting] == voted[_msgSender()][voting])
            return false;

        votes[voting][_vote] = votes[voting][_vote] + 1;
        voters[voting][_vote].push(_msgSender());
        voted[_msgSender()][voting]++;

        emit Voted(votes[voting][_vote], _msgSender());

        return true;
    }

    // add voter (only from the one who created voting)
    function addVoter(address voter, uint256 voting, uint256 _votes) public payable returns (bool) {
        if (votings[_msgSender()] != voting)
            return false;

        votingAllowed[voter][voting] = _votes;

        return true;
    }

    // Get votes of voting
    function getVotes(uint256 voting) public view returns (uint256[] memory) {
        return votes[voting];
    }

    function getVotingOptions(uint256 voting) public view returns (string[] memory){
        return optionNames[voting];
    }

    // Get voters of voting
    function getVoters(uint256 voting, uint256 _vote) public view returns (address[] memory) {
        return voters[voting][_vote];
    }

    // get votings of one
    function availableVotings() public view returns (votingModel[] memory) {
        votingModel[] memory myVotings = new votingModel[](10);
        uint256 counter = 0;

        for (uint i=0; i<votingCounter; i++) {
            if (votingAllowed[_msgSender()][i] > 0){
                votingModel memory v = votingModel(i, votesName[i]);
                myVotings[counter++] = v;
            }
        }

        return myVotings;
    }

    // Safe access to msg.sender
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

}
